import React from "react";
import "./Game.scss";
import Board from "./Board/Board";
import { Row, Col } from "react-bootstrap";

const Game = (props) => {
  return (
    <Row md={{ cols: 2 }} className="mt-5">
      <Col md={{ span: 6 }} className="board-container">
        <div className="opponent-area">
          <div className="avatar-and-name"></div>
          <Timer />
        </div>
        <Board side={["black", "red"]} />
      </Col>
      <Col md={{ span: 5 }} className="game-controller"></Col>
    </Row>
  );
};

export default Game;
